import React from "react";
import { Card } from "react-bootstrap";

import { Link } from "react-router-dom";

const Home = () => {
    return <Card className="home">
        <div>
      <Link to='/NewTicket'>Create New Ticket</Link>
      </div>
    </Card>
}

export default Home;
